const tcomb = require('tcomb')

const IMAGE = tcomb.struct({
    id: tcomb.String,
    image: tcomb.String,
}, {strict: false})

const images = [
    {
        id:'45745c60-7b1a-11e8-9c9c-2d42b21b1a3e',
        image:'data:image/jpeg;base64,'
    },
    {
        id:'456897d-98a8-78d8-4565-2d42b21b1a3e',
        image:'data:image/jpeg;base64,'
    }
]

const get = (id) => {
    const imagesFound = images.filter((images) => images.id === id)
    return imagesFound.length >= 1
        ? imagesFound[0]
        : undefined
}

const add = (image) => {
    console.log("test" + image)
    const newImage = {
        ...image
    }
    if (validateImage(newImage)) {
        images.push(newImage)
    } else {
        console.log(newImage)
        throw new Error('image.not.valid')
    }
    console.log(newImage)
    return newImage
}

const getAll = () => {
    return images
}


function validateImage(image) {
    let result = true
    if (image && image.id && image.image) {
        result = true
    }
    return result
}

exports.get = get
exports.getAll = getAll
exports.add = add